import {Link} from "react-router-dom";
import Spider from "../img/SPIDER.jpg"



const DashCourseTile=()=>{
    return(
        <Link to="/OpenCourse" >
        <div className="flex m-2 flex-col  h-60 w-74 rounded-xl bg-white border-solid border border-sky-500 ">
            <div className="border-white   w-72 ">
                    <img src={Spider} className=" h-36mx-auto my-2 rounded-xl"></img>
                    <h3 className="mx-auto">COURSE 1234</h3>
            </div>
            <div className=" flex  flex-col h-20 w-72 bg-white border-solid rounded-xl  border-1 border-sky-500">
                
                <p className="mx-auto mt-6">Data Sturcture</p>
            </div>
        </div>
        </Link>
    )
}


export default DashCourseTile;
